let _markdown = "\n\nThemes [#themes]\n\nLinkDen ships with 7 built-in themes, each available in dark and light variants (14 total). An auto mode follows the visitor's system preference.\n\nAvailable Themes [#available-themes]\n\nDefault [#default]\n\nA clean, modern design with cyan (`#0FACED`) accents. Medium border radius. Works for any brand.\n\nCorporate Classic [#corporate-classic]\n\nProfessional navy (`#1E3A5F`) palette with subtle border radius. Clean and authoritative.\n\nCorporate Modern [#corporate-modern]\n\nTeal (`#0D9488`) accents with a contemporary feel. Balanced border radius.\n\nHacker Terminal [#hacker-terminal]\n\nGreen (`#16A34A`) on dark background with no border radius. Monospace-inspired, sharp and technical.\n\nNeon Cyber [#neon-cyber]\n\nBold purple (`#7C3AED`) accents with large border radius. Eye-catching and vibrant.\n\nFurry Pastel [#furry-pastel]\n\nSoft pink (`#EC4899`) palette with fully rounded corners (`1rem`). Warm and approachable.\n\nFurry Bold [#furry-bold]\n\nEnergetic orange (`#EA580C`) with large border radius. Stands out with high energy.\n\nTheme CSS Variables [#theme-css-variables]\n\nEach theme defines the following CSS custom properties for both light and dark variants:\n\n| Variable                | Description                 |\n| ----------------------- | --------------------------- |\n| `--ld-primary`          | Primary accent color        |\n| `--ld-secondary`        | Secondary color             |\n| `--ld-accent`           | Accent color for highlights |\n| `--ld-action`           | Action/button color         |\n| `--ld-background`       | Page background             |\n| `--ld-foreground`       | Main text color             |\n| `--ld-card`             | Card background             |\n| `--ld-card-foreground`  | Card text color             |\n| `--ld-border`           | Border color                |\n| `--ld-muted`            | Muted background            |\n| `--ld-muted-foreground` | Muted text color            |\n| `--ld-radius`           | Border radius               |\n\nSelecting a Theme [#selecting-a-theme]\n\n1. Navigate to `/admin/appearance` in the admin panel.\n2. Browse the theme preset picker.\n3. Click a theme to select it.\n\nAlternatively, select a theme during the setup wizard at `/admin/setup` (Step 3).\n\nColor Modes [#color-modes]\n\nEach theme supports three modes:\n\n* **Light** -- Forces the light variant regardless of system preference.\n* **Dark** -- Forces the dark variant regardless of system preference.\n* **System** -- Follows the visitor's operating system preference.\n\nVisitors can toggle between light and dark mode using the theme toggle on the public page.\n\nCustomizing Colors [#customizing-colors]\n\nBeyond the theme presets, you can override individual colors through the appearance settings:\n\n* **Primary color** -- Override `--ld-primary`.\n* **Secondary color** -- Override `--ld-secondary`.\n* **Accent color** -- Override `--ld-accent`.\n* **Background color** -- Override `--ld-background`.\n\nYou can also add **custom CSS** for fine-grained control over any theme variable or element.\n";
