let _markdown = "\n\nLinks & Blocks [#links--blocks]\n\nLinkDen supports 5 block types that appear on your public page in the order you arrange them. All blocks are managed from the block builder at `/admin/builder`.\n\nBlock Types [#block-types]\n\nLink [#link]\n\nThe most common block type. A clickable button that takes visitors to an external URL.\n\n* **Title** -- The text displayed on the button.\n* **URL** -- The destination URL.\n* **Icon** -- Optional icon identifier.\n* **Config options**: emoji, emoji position, icon slug, icon position, text alignment, font weight, outlined style, open in new tab.\n\nHeader [#header]\n\nA text heading that visually separates groups of blocks. Useful for organizing content into categories.\n\n* **Title** -- The heading text.\n* **Config options**: heading level (h1-h6), text alignment, font weight, emoji, emoji position, show divider line.\n\nSocial Icons [#social-icons]\n\nA row of social media icon links. Uses the social networks you have activated in `/admin/social`.\n\n* **Config options**: icon size, icon style (filled, outlined, rounded), show labels, spacing, use brand colors.\n\nEmbed [#embed]\n\nEmbed content from external platforms directly on your page.\n\n* **Embed Type** -- YouTube, Spotify, SoundCloud, or Custom.\n* **Embed URL** -- The source URL to embed.\n* **Config options**: aspect ratio, max width, show title.\n\nContact Form [#contact-form]\n\nAn inline contact form for visitors to send you messages.\n\n* **Config options**: button text, button emoji, button emoji position, success message.\n\nThe contact form requires configuration in `/admin/settings` (Contact Form and optionally CAPTCHA sections).\n\nBlock Configuration [#block-configuration]\n\nAll block types share a base configuration with these style options:\n\n| Option                  | Description                       |\n| ----------------------- | --------------------------------- |\n| Color variant           | Preset color scheme for the block |\n| Custom background color | Override background color         |\n| Custom text color       | Override text color               |\n| Custom border color     | Override border color             |\n| Border radius           | Corner rounding                   |\n| Border width            | Border thickness                  |\n| Shadow                  | Drop shadow effect                |\n| Animation               | Hover or entrance animation       |\n| Padding                 | Inner spacing                     |\n\nScheduling [#scheduling]\n\nBlocks support scheduled visibility with start and end dates. A block outside its scheduled window is automatically hidden from the public page. Configure scheduling in the **Schedule** tab of the block edit panel.\n\nManaging Blocks [#managing-blocks]\n\nAdding a Block [#adding-a-block]\n\n1. Open the block builder at `/admin/builder`.\n2. Click **Add Block** to open the dropdown menu.\n3. Select a block type.\n4. The block is added and the edit panel opens.\n\nReordering Blocks [#reordering-blocks]\n\nDrag any block by its grip handle in the block list. The order is saved immediately.\n\nEditing a Block [#editing-a-block]\n\nClick the pencil icon on any block to open the edit panel with 4 tabs: Content, Style, Options, and Schedule.\n\nToggling Visibility [#toggling-visibility]\n\nClick the eye icon to toggle a block's visibility. Hidden blocks remain in your list but are not shown on the public page.\n\nDeleting a Block [#deleting-a-block]\n\nClick the trash icon on any block to delete it. Deletions are permanent.\n\nSocial Networks [#social-networks]\n\nSocial networks for the Social Icons block type are managed separately at `/admin/social`. This page lets you:\n\n* Search networks by name or slug.\n* Filter to show all or only active networks.\n* Toggle networks on/off with a switch.\n\nActive networks become available for use in Social Icons blocks.\n";
