let _markdown = "\n\nAppearance [#appearance]\n\nThe appearance settings at `/admin/appearance` let you customize the visual look of your public link page beyond the base theme.\n\nTheme Presets [#theme-presets]\n\nChoose from 7 built-in theme presets. Each preset defines a complete color palette for both light and dark modes. See the [Themes](/docs/features/themes) page for details on each theme.\n\nColor Customization [#color-customization]\n\nOverride individual theme colors:\n\n* **Primary color** -- The main accent color used for buttons and interactive elements.\n* **Secondary color** -- Supporting color for secondary elements.\n* **Accent color** -- Highlight color for emphasis.\n* **Background color** -- Override the page background.\n\nColors are set via CSS custom properties (`--ld-primary`, `--ld-secondary`, etc.) and apply on top of the selected theme preset.\n\nDefault Color Mode [#default-color-mode]\n\nSet the default color mode for visitors:\n\n* **Light** -- Forces the light variant.\n* **Dark** -- Forces the dark variant.\n* **System** -- Follows the visitor's OS preference.\n\nVisitors can always toggle between light and dark mode using the theme toggle button on the public page.\n\nCustom CSS [#custom-css]\n\nFor advanced customization, add custom CSS that is injected into your public page. This lets you:\n\n* Override any theme variable or style.\n* Add animations or transitions.\n* Style specific elements with custom selectors.\n* Implement completely unique designs.\n\nDark / Light Mode Toggle [#dark--light-mode-toggle]\n\nVisitors to your public page can switch between dark and light mode using the theme toggle button. The initial mode is determined by:\n\n1. The visitor's saved preference (stored in `localStorage`).\n2. Your site's default color mode setting.\n3. The visitor's OS-level color scheme preference if \"system\" is selected.\n\nWhitelabel [#whitelabel]\n\nToggle off all LinkDen branding with a single switch in `/admin/settings` under the **Branding** section:\n\n* Removes the \"Powered by LinkDen\" footer.\n* Optionally shows custom footer text and link instead.\n* No attribution is required under the MIT license.\n";
